import React, { useState } from "react";
import "./Dicegame.css";
import dice from "./dices 1.png";
import first from './dice_1.png';
import second from './dice_2.png';
import third from './dice_3.png';
import four from './dice_4.png';
import five from './dice_5.png';
import six from './dice_6.png';





export default function Dicegame() {
  const [dicenumber, setDicenumber] = useState(0);
  const RandomNumber = () =>{
    setDicenumber()
  }
  return (
    <div>
      <h6 className="top">Error</h6>
      <div class="container">
        <h1 class="heading">Score: 0</h1>
        <div class="buttons">
          <button class="button">1</button>
          <button class="button">2</button>
          <button class="button">3</button>
          <button class="button">4</button>
          <button class="button">5</button>
          <button class="button">6</button>
        </div>
      </div>
      <h6>Select number</h6>

      <div className="imagecontainer">
        <div class="containerr">
          <div class="image-container">
            <img src={dice} alt="Your Image" />
          </div>
          <div class="button-container">
            <button class="button-button" onClick={RandomNumber}>Roll Dice</button>
            <button class="button-button">Reset Score</button>
          </div>
        </div>
      </div>
    </div>
  );
}
